import React from 'react'

export default function Address() {

    fetch('https://api.ipify.org')
    .then((response) => response.json())
    .then((data) => console.log(data));
    

    fetch('https://api64.ipify.org')
    .then((response) => response.json())
    .then((data) => console.log(data));

  return (
    <div>Address</div>
  )
}
